import Calculator from './component/Calculator';
import { useTheme } from "../../ThemeContext";


function App1() {
  const { darkMode } = useTheme();

  return (
    <div className={darkMode ? "dark-mode" : "light-mode"}>
      <h1 className="h1"> Calculatrice</h1>
      <Calculator />
    </div>
  );
}

export default App1;
